"use strict"

import React, { Component } from 'react';
import { Button, Image, StyleSheet, View } from 'react-native';

export default class GlobalData extends Component {
    render() {
        if (this.props.visible === false) {
            return null;
        }
        return (
            <View style={styles.dataButton}>
                <Button
                    title="Daten"
                    onPress={() => alert('Hey')} />
            </View>
        )
    }
}

const styles = StyleSheet.create({
    container: {
        width: '100%',
        height: '85%',
        flexDirection: 'row',
        flexWrap: 'wrap'
    },
    box: {
        width: '50%',
        height: '50%',
        padding: 5
    },
    inner: {
        dataButton: {
            borderWidth: 1,
            height: 60,
            width: 60,
            position: 'absolute',
            justifyContent: 'center',
            right: 15,
            bottom: 10
        },
    }
})
